import React, { useState } from 'react';
import { Modal } from '@mui/material';

const imagesData = [
  {
    mainimg: 'data:image/jpeg;base64,',
    subimginmodal: [
      '/images/gallery1_1.jpg',
      '/images/gallery1_2.jpg',
      '/images/gallery1_3.jpg',
    ],
  },
  {
    mainimg: 'data:image/jpeg;base64,',
    subimginmodal: [
      '/images/gallery2_1.jpg',
      '/images/gallery2_2.jpg',
      '/images/gallery2_3.jpg',
    ],
  },
  {
    mainimg: 'data:image/jpeg;base64,',
    subimginmodal: [
      '/images/gallery3_1.jpg',
      '/images/gallery3_2.jpg',
      '/images/gallery3_3.jpg',
    ],
  },
  {
    mainimg: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTDKsGca-rs3f00pGuUq47jXyApZNOq-Gu7Gg&s',
    subimginmodal: [
      '/images/gallery3_1.jpg',
      '/images/gallery3_2.jpg',
      '/images/gallery3_3.jpg',
    ],
  },
];

const PhotoGallery = () => {
  const [modalOpen, setModalOpen] = useState(false);
  const [selectedImageGroup, setSelectedImageGroup] = useState([]);
  const [currentIndex, setCurrentIndex] = useState(0);

  const openModal = (subImages) => {
    setSelectedImageGroup(subImages);
    setCurrentIndex(0);
    setModalOpen(true);
  };

  const closeModal = () => {
    setModalOpen(false);
  };

  const nextImage = () => {
    setCurrentIndex((currentIndex + 1) % selectedImageGroup.length);
  };

  const prevImage = () => {
    setCurrentIndex((currentIndex - 1 + selectedImageGroup.length) % selectedImageGroup.length);
  };

  return (
    <section className="py-10 px-4">
      <h2 className="text-3xl font-bold text-center text-green-800 mb-8">Photo Gallery</h2>

      <div className="max-w-6xl mx-auto grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
        {imagesData.map((item, index) => (
          <img
            key={index}
            src={item.mainimg}
            alt={`Gallery Main ${index + 1}`}
            className="w-full h-48 object-cover rounded-lg shadow cursor-pointer hover:scale-105 transition duration-300"
            onClick={() => openModal(item.subimginmodal)}
          />
        ))}
      </div>

      <Modal
        open={modalOpen}
        onClose={closeModal}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <div className="fixed inset-0 flex items-center justify-center bg-black bg-opacity-80 p-4">
          <div className="relative max-w-4xl w-full bg-white rounded-lg shadow-lg p-4">
            <button
              onClick={closeModal}
              className="absolute top-2 right-4 text-3xl font-bold text-red-700"
            >
              &times;
            </button>

            <img
              src={selectedImageGroup[currentIndex]}
              alt={`Gallery Modal ${currentIndex + 1}`}
              className="w-full h-[70vh] object-contain rounded-md"
            />

            {/* Arrows */}
            <button
              onClick={prevImage}
              className="absolute top-1/2 left-2 transform -translate-y-1/2 text-3xl text-gray-700 hover:text-black"
            >
              &#10094;
            </button>
            <button
              onClick={nextImage}
              className="absolute top-1/2 right-2 transform -translate-y-1/2 text-3xl text-gray-700 hover:text-black"
            >
              &#10095;
            </button>
          </div>
        </div>
      </Modal>
    </section>
  );
};

export default PhotoGallery;
